import React from 'react';

export default class Filters extends React.Component {

    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div className="portfolio-list">
                <ul className="nav list-unstyled" id="portfolio-flters">
                    <li className="filter" data-item="all" onClick={this.props.filter}>All</li>
                    <li className="filter" data-item="general" onClick={this.props.filter}>Branding</li>
                    <li className="filter" data-item="game" onClick={this.props.filter}>Game Design</li>
                    <li className="filter" data-item="web" onClick={this.props.filter}>Web Design</li>
                    <li className="filter" data-item="social" onClick={this.props.filter}>social media</li>
                </ul>
            </div>
        );
    }
}
